using MareSynchronos.API.Data;
using MareSynchronos.API.Data.Comparer;
using MareSynchronos.MareConfiguration;
using MareSynchronos.Services.Mediator;
using MareSynchronos.WebAPI;
using Microsoft.Extensions.Logging;
using System.Collections.Concurrent;
using System.Runtime.Versioning;

namespace MareSynchronos.Services;

public record MareProfileData(bool IsFlagged, bool IsNSFW, string Base64ProfilePicture, string Base64SupporterPicture, string Description)
{
    public Lazy<byte[]> ImageData { get; } = new Lazy<byte[]>(Convert.FromBase64String(Base64ProfilePicture));
    public Lazy<byte[]> SupporterImageData { get; } = new Lazy<byte[]>(string.IsNullOrEmpty(Base64SupporterPicture) ? Array.Empty<byte>() : Convert.FromBase64String(Base64SupporterPicture));
}

public class MareProfileManager : MediatorSubscriberBase
{
    private const string _mareLogo = "";
    private const string _mareLogoLoading = "";
    private const string _mareSupporter = "";
    private const string _noDescription = "-- User has no description set --";
    private const string _nsfw = "Profile not displayed - NSFW";
    private readonly ApiController _apiController;
    private readonly MareConfigService _mareConfigService;
    private readonly ConcurrentDictionary<UserData, MareProfileData> _mareProfiles = new(UserDataComparer.Instance);

    private readonly MareProfileData DefaultProfileData = new(false, false, _mareLogo, string.Empty, _noDescription);
    private readonly MareProfileData LoadingProfileData = new(false, false, _mareLogoLoading, string.Empty, "Loading Data from server...");
    private readonly MareProfileData NsfwProfileData = new(false, false, _mareLogo, string.Empty, _nsfw);

    public MareProfileManager(ILogger<MareProfileManager> logger, MareConfigService mareConfigService,
        MareMediator mediator, ApiController apiController) : base(logger, mediator)
    {
        _mareConfigService = mareConfigService;
        _apiController = apiController;

        Mediator.Subscribe<ClearProfileDataMessage>(this, (msg) =>
        {
            if (msg.UserData != null)
                _mareProfiles.Remove(msg.UserData, out _);
            else
                _mareProfiles.Clear();
        });
        Mediator.Subscribe<DisconnectedMessage>(this, (_) => _mareProfiles.Clear());
    }

    public (bool Loaded, MareProfileData Profile) GetMareProfile(UserData data)
    {
        if (!_mareProfiles.TryGetValue(data, out var profile))
        {
            Task.Run(() => GetMareProfileFromService(data));
            return (false, LoadingProfileData);
        }

        return (true, profile);
    }

    private async Task GetMareProfileFromService(UserData data)
    {
        try
        {
            var profile = await _apiController.UserGetProfile(new API.Dto.User.UserDto(data)).ConfigureAwait(false);
            MareProfileData profileData = new(profile.Disabled, profile.IsNSFW ?? false, string.IsNullOrEmpty(profile.ProfilePictureBase64) ? _mareLogo : profile.ProfilePictureBase64,
                !string.IsNullOrEmpty(data.Alias) && !string.Equals(data.Alias, data.UID, StringComparison.Ordinal) ? _mareSupporter : string.Empty,
                string.IsNullOrEmpty(profile.Description) ? _noDescription : profile.Description);
            if (profileData.IsNSFW && !_mareConfigService.Current.ProfilesAllowNsfw && !string.Equals(_apiController.UID, data.UID, StringComparison.Ordinal))
            {
                _mareProfiles[data] = NsfwProfileData;
            }
            else
            {
                _mareProfiles[data] = profileData;
            }
        }
        catch (Exception ex)
        {
            // if fails save DefaultProfileData to dict
            Logger.LogWarning(ex, "Failed to get Profile from service for user {user}", data);
            _mareProfiles[data] = DefaultProfileData;
        }
    }
}